wJAAAMCQAADAkAAAwJAEDs1kERQFAAQEFOCsjhqIEqAuh/UILxzdtNsRAkAAAQJAAAECQAABAkAAAQJAAAECQAABAkAAAQJAAAECQAABAkAAAQJAAAECQAABAkAAAQJAAAECQAABAkAAAQJAAAECQAABAkAAAQJAAAECQAABAkAAAQJAAAvOlcGNIxf+ZaGNM2ATxmn4F/WCcAAYAcAQAEAIIEABAACBIAQAAgSAAAAYAgAbjZrQMBAAAAAEH+1oNcFAECAEMCAAgADAkAIAAwJACAAMCQAAACAEMCAAgADAkAIAAwJACAAMCQAAACAEMCAAgADAkAIAAwJACAAMCQAAACAEMCAAgADAkAIAAwJACAAMCQAAACAEMCAAgADAkAIAAwJACAAMCQAAACAEMCAAgADAkAIAAwJACAAMCQAAACAEMCAAgADAkAIAAwJACAAMCQAAACAEMCAAgA1G4dCAAAADAM8re+x1cUBQkAIAAQJACAAECQAAACAEECAAgABAkAIAAQJACAAECQAAACAEECAAgABAkAIAAQJACAAECQAAACAEECAAgABAkAIAAQJACAAECQAAACAEECAAgABAkAIAAQJACAAECQAAACAEECAAgABAkAIAAQdBqAAf3El+pAhpkPAAAAAElFTkSuQmCC\",\"mime\":\"image/png\",\"copyright\":{\"license\":\"U\"},\"width\":2048,\"height\":2048},\"alt\":\"elektroskop1\",\"title\":\"elektroskop1\"},\"library\":\"H5P.Image 1.1\",\"metadata\":{\"contentType\":\"Image\",\"license\":\"C\",\"title\":\"elektroskop1\",\"authors\":[{\"name\":\"Joachim Herz Stiftung\",\"role\":\"Author\"}],\"source\":\"https://www.leifiphysik.de\",\"defaultLanguage\":\"de\"},\"subContentId\":\"8df3f7a2-f62b-4514-99c7-08d9b2e7a260\"},\"disableImageZooming\":false},\"answers\":[{\"correct\":true,\"tipsAndFeedback\":{\"chosenFeedback\":\"<div>Wenn das Elektroskop positiv geladen ist, dann sind auch Gestänge und Zeiger positiv geladen. Die beiden stoßen sich ab (= \\\"wollen voneinander weg\\\") und der drehbare Zeiger schlägt aus.</div>\\n\",\"tip\":\"\",\"notChosenFeedback\":\"<div>Wenn das Elektroskop positiv geladen ist, dann sind auch Gestänge und Zeiger positiv geladen. Die beiden stoßen sich ab (= \\\"wollen voneinander weg\\\") und der drehbare Zeiger schlägt aus.</div>\\n\"},\"text\":\"<div>Wenn das Elektroskop positiv aufgeladen wird, dann schlägt das Elektroskop aus.</div>\\n\"},{\"correct\":true,\"tipsAndFeedback\":{\"tip\":\"\",\"chosenFeedback\":\"<div>Wenn das Elektroskop negativ geladen ist, dann sind auch Gestänge und Zeiger negativ geladen. Die beiden stoßen sich ab (= \\\"wollen voneinander weg\\\") und der drehbare Zeiger schlägt aus.</div>\\n\",\"notChosenFeedback\":\"<div>Wenn das Elektroskop negativ geladen ist, dann sind auch Gestänge und Zeiger negativ geladen. Die beiden stoßen sich ab (= \\\"wollen voneinander weg\\\") und der drehbare Zeiger schlägt aus.</div>\\n\"},\"text\":\"<div>Wenn das Elektroskop negativ aufgeladen wird, dann schlägt das Elektroskop aus.</div>\\n\"},{\"correct\":false,\"tipsAndFeedback\":{\"tip\":\"\",\"chosenFeedback\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"<div>Wenn das Elektroskop ungeladen ist, dann schlägt das Elektroskop aus.</div>\\n\"},{\"correct\":false,\"tipsAndFeedback\":{\"chosenFeedback\":\"<div>Der Zeiger und das Gestänge stoßen sich ab, wenn sie die gleiche Ladung haben. Das hat nichts damit zu tun, ob sie positiv oder negativ geladen sind. Beides hat also das selbe Ergebnis.</div>\\n\",\"tip\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"<div>Wenn das Elektroskop positiv aufgeladen wird, dreht sich der Zeiger im Uhrzeigersinn. Wenn das Elektroskop negativ aufgeladen wird, dreht sich der Zeiger entgegen dem Uhrzeigersinn.</div>\\n\"}],\"overallFeedback\":[{\"from\":0,\"to\":100}],\"behaviour\":{\"enableRetry\":true,\"enableSolutionsButton\":true,\"enableCheckButton\":true,\"type\":\"auto\",\"singlePoint\":false,\"randomAnswers\":true,\"showSolutionsRequiresInput\":true,\"confirmCheckDialog\":false,\"confirmRetryDialog\":false,\"autoCheck\":false,\"passPercentage\":100,\"showScorePoints\":true},\"UI\":{\"checkAnswerButton\":\"Überprüfen\",\"showSolutionButton\":\"Lösung anzeigen\",\"tryAgainButton\":\"Wiederholen\",\"tipsLabel\":\"Hinweis anzeigen\",\"scoreBarLabel\":\"Du hast :num von :total Punkten erreicht.\",\"tipAvailable\":\"Hinweis verfügbar\",\"feedbackAvailable\":\"Rückmeldung verfügbar\",\"readFeedback\":\"Rückmeldung vorlesen\",\"wrongAnswer\":\"Falsche Antwort\",\"correctAnswer\":\"Richtige Antwort\",\"shouldCheck\":\"Hätte gewählt werden müssen\",\"shouldNotCheck\":\"Hätte nicht gewählt werden sollen\",\"noInput\":\"Bitte antworte, bevor du die Lösung ansiehst\",\"a11yCheck\":\"Die Antworten überprüfen. Die Auswahlen werden als richtig, falsch oder fehlend markiert.\",\"a11yShowSolution\":\"Die Lösung anzeigen. Die richtigen Lösungen werden in der Aufgabe angezeigt.\",\"a11yRetry\":\"Die Aufgabe wiederholen. Alle Versuche werden zurückgesetzt und die Aufgabe wird erneut gestartet.\"},\"confirmCheck\":{\"header\":\"Beenden?\",\"body\":\"Ganz sicher beenden?\",\"cancelLabel\":\"Abbrechen\",\"confirmLabel\":\"Beenden\"},\"confirmRetry\":{\"header\":\"Wiederholen?\",\"body\":\"Ganz sicher wiederholen?\",\"cancelLabel\":\"Abbrechen\",\"confirmLabel\":\"Bestätigen\"},\"question\":\"<p>Hier sieht man die Skizze eines Elektroskops. Der Zeiger ist drehbar. Wenn sich der Zeiger vom Gestänge weg dreht, sagt man: \\\"Der Zeiger schlägt aus\\\". Gleiche Ladungen stoßen sich ab!</p>\\n\\n<p>Welche Aussagen über das Elektroskop sind richtig?</p>\\n\"},\"library\":\"H5P.MultiChoice 1.14\",\"metadata\":{\"contentType\":\"Multiple Choice\",\"license\":\"U\",\"title\":\"Elektroskop 1\",\"defaultLanguage\":\"de\"},\"subContentId\":\"19e16fec-42c4-4ed7-ab2b-3523f6bc34e7\"},{\"params\":{\"scoreShow\":\"Überprüfen\",\"tryAgain\":\"Wiederholen\",\"scoreExplanation\":\"Richtige Antworten geben +1 Punkte. Bei falschen Antworten gibt es -1 Punkt. Die kleinstmögliche Punktzahl ist 0.\",\"question\":{\"settings\":{\"size\":{\"width\":800,\"height\":600}},\"task\":{\"elements\":[{\"x\":1.6155088852989,\"y\":0,\"width\":48.201373182553,\"height\":2.0032310177706,\"dropZones\":[],\"type\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Berührst du mit einer negativ geladenen Kugel ein Elektroskop, so schlägt der Zeiger aus. Aber warum? Bringe die Erklärung in die richtige Reihenfolge.</p>\\n\"},\"subContentId\":\"865e667c-0c79-4356-9aea-c9ce23b88cde\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"defaultLanguag on und Körper an.</div>\\n\",\"tip\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"<div>Nichts passiert.</div>\\n\"}],\"overallFeedback\":[{\"from\":0,\"to\":100}],\"behaviour\":{\"enableRetry\":true,\"enableSolutionsButton\":true,\"enableCheckButton\":true,\"type\":\"single\",\"singlePoint\":false,\"randomAnswers\":true,\"showSolutionsRequiresInput\":true,\"confirmCheckDialog\":false,\"confirmRetryDialog\":false,\"autoCheck\":false,\"passPercentage\":100,\"showScorePoints\":true},\"UI\":{\"checkAnswerButton\":\"Überprüfen\",\"showSolutionButton\":\"Lösung anzeigen\",\"tryAgainButton\":\"Wiederholen\",\"tipsLabel\":\"Hinweis anzeigen\",\"scoreBarLabel\":\"Du hast :num von :total Punkten erreicht.\",\"tipAvailable\":\"Hinweis verfügbar\",\"feedbackAvailable\":\"Rückmeldung verfügbar\",\"readFeedback\":\"Rückmeldung vorlesen\",\"wrongAnswer\":\"Falsche Antwort\",\"correctAnswer\":\"Richtige Antwort\",\"shouldCheck\":\"Hätte gewählt werden müssen\",\"shouldNotCheck\":\"Hätte nicht gewählt werden sollen\",\"noInput\":\"Bitte antworte, bevor du die Lösung ansiehst\",\"a11yCheck\":\"Die Antworten überprüfen. Die Auswahlen werden als richtig, falsch oder fehlend markiert.\",\"a11yShowSolution\":\"Die Lösung anzeigen. Die richtigen Lösungen werden in der Aufgabe angezeigt.\",\"a11yRetry\":\"Die Aufgabe wiederholen. Alle Versuche werden zurückgesetzt und die Aufgabe wird erneut gestartet.\"},\"confirmCheck\":{\"header\":\"Beenden?\",\"body\":\"Ganz sicher beenden?\",\"cancelLabel\":\"Abbrechen\",\"confirmLabel\":\"Beenden\"},\"confirmRetry\":{\"header\":\"Wiederholen?\",\"body\":\"Ganz sicher wiederholen?\",\"cancelLabel\":\"Abbrechen\",\"confirmLabel\":\"Bestätigen\"},\"question\":\"<p>Bringst du einen negativ geladenen Luftballon in die Nähe eines neutralen (ungeladenen) Körpers, so verschieben sich die Ladungen im neutralen Körper. Dieser Körper ist dann in einem Bereich positiv geladen und in einem anderen Bereich negativ geladen.</p>\\n\\n<p>Was machen der geladene Luftballon und der andere Körper, wenn du beide nahe zueinander bringst?</p>\\n\"},\"library\":\"H5P.MultiChoice 1.14\",\"metadata\":{\"contentType\":\"Multiple Choice\",\"license\":\"U\",\"title\":\"Influenz 2\",\"defaultLanguage\":\"de\"},\"subContentId\":\"d7c36ce0-1d85-42e9-8556-f444598e00a9\"},{\"params\":{\"scoreShow\":\"Überprüfen\",\"tryAgain\":\"Wiederholen\",\"scoreExplanation\":\"Richtige Antworten geben +1 Punkte. Bei falschen Antworten gibt es -1 Punkt. Die kleinstmögliche Punktzahl ist 0.\",\"question\":{\"settings\":{\"size\":{\"width\":800,\"height\":600}},\"task\":{\"elements\":[{\"x\":0,\"y\":0,\"width\":49.010500807754,\"height\":5.1561631663974,\"dropZones\":[],\"type\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Influenz tritt auch bei Isolatoren auf. Diese Influenz kannst du sehen, wenn<span style=\\\"font-size:1em\\\"> leichte Dinge (z.B. Papierschnipsel) einem geladenem Körper nahe kommen. </span></p>\\n\\n<p><span style=\\\"font-size:1em\\\">Bringe die Bilder des Experiments in die richtige Reihenfolge (von links nach rechts)! Mehr Informationen zu jedem Bild bekommst du, wenn du mit der Maus über dem Bild bleibst.</span></p>\\n\"},\"subContentId\":\"37140f80-7643-4d97-b91f-a3eae3f7949c\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"defaultLanguage\":\"de\"}},\"backgroundOpacity\":100,\"multiple\":false},{\"x\":58.158319870759286,\"y\":64.65517241379311,\"width\":11.286762103909,\"height\":11.286762103909,\"dropZones\":[\"0\",\"1\",\"2\",\"3\"],\"type\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAB/0AAAf9CAMAAACsd6rDAAAC+lBMVEUAAACBgYGBgYGenp7Ly8tUpb43q8iIiIiUlJSvr6+YmJjMzMyAgICDg4M8qcM3q8ikpKQ3rMg3qck2qsm7u7s3q8g3q8jFxcU3rMiFhYU3q8g3q8g3rMg3q8g3q8g2q8k3q8g3q8g2q8k3q8g3q8g3q8g3q8g2rMk3q8g3q8k3qsg3rMg2q8mkpKQ2q8mMjIympqY3rMg3q8g2q8nBwcGurq43rMg3rMg3q8iysrKkpKSZmZk3qsilpaWqqqqdnZ2goKCqqqqmpqaZmZmrq >Die Kugel wird negativ aufgeladen, da die negativ geladene Platte näher ist.</div>\\n\"},{\"correct\":true,\"tipsAndFeedback\":{\"tip\":\"\",\"chosenFeedback\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"<div>Die negativen Ladungen in der Kugel werden nach rechts verschoben. Es bildet sich rechts in der Kugel ein negativ geladener Bereich und links in der Kugel ein positiv geladener Bereich.</div>\\n\"},{\"correct\":false,\"tipsAndFeedback\":{\"tip\":\"\",\"chosenFeedback\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"<div>Die negativen Ladungen in der Kugel werden nach links verschoben. Es bildet sich links in der Kugel ein negativ geladener Bereich und rechts in der Kugel ein positiv geladener Bereich.</div>\\n\"},{\"correct\":false,\"tipsAndFeedback\":{\"tip\":\"\",\"chosenFeedback\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"<div>Die Kugel wird positiv aufgeladen, da die negativ geladene Platte näher ist.</div>\\n\"},{\"correct\":true,\"tipsAndFeedback\":{\"tip\":\"\",\"chosenFeedback\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"<div>Die Kugel wird gar nicht elektrisch aufgeladen.</div>\\n\"}],\"overallFeedback\":[{\"from\":0,\"to\":100}],\"behaviour\":{\"enableRetry\":true,\"enableSolutionsButton\":true,\"enableCheckButton\":true,\"type\":\"auto\",\"singlePoint\":false,\"randomAnswers\":true,\"showSolutionsRequiresInput\":true,\"confirmCheckDialog\":false,\"confirmRetryDialog\":false,\"autoCheck\":false,\"passPercentage\":100,\"showScorePoints\":true},\"UI\":{\"checkAnswerButton\":\"Überprüfen\",\"showSolutionButton\":\"Lösung anzeigen\",\"tryAgainButton\":\"Wiederholen\",\"tipsLabel\":\"Hinweis anzeigen\",\"scoreBarLabel\":\"Du hast :num von :total Punkten erreicht.\",\"tipAvailable\":\"Hinweis verfügbar\",\"feedbackAvailable\":\"Rückmeldung verfügbar\",\"readFeedback\":\"Rückmeldung vorlesen\",\"wrongAnswer\":\"Falsche Antwort\",\"correctAnswer\":\"Richtige Antwort\",\"shouldCheck\":\"Hätte gewählt werden müssen\",\"shouldNotCheck\":\"Hätte nicht gewählt werden sollen\",\"noInput\":\"Bitte antworte, bevor du die Lösung ansiehst\",\"a11yCheck\":\"Die Antworten überprüfen. Die Auswahlen werden als richtig, falsch oder fehlend markiert.\",\"a11yShowSolution\":\"Die Lösung anzeigen. Die richtigen Lösungen werden in der Aufgabe angezeigt.\",\"a11yRetry\":\"Die Aufgabe wiederholen. Alle Versuche werden zurückgesetzt und die Aufgabe wird erneut gestartet.\"},\"confirmCheck\":{\"header\":\"Beenden?\",\"body\":\"Ganz sicher beenden?\",\"cancelLabel\":\"Abbrechen\",\"confirmLabel\":\"Beenden\"},\"confirmRetry\":{\"header\":\"Wiederholen?\",\"body\":\"Ganz sicher wiederholen?\",\"cancelLabel\":\"Abbrechen\",\"confirmLabel\":\"Bestätigen\"},\"question\":\"<p>Eine ungeladene Kugel hängt näher an der linken Platte eines Plattenkondensators. Eine Influenzmaschine lädt die linke Platte negativ auf und lädt die rechte Platte positiv auf.</p>\\n\\n<p>Was passiert mit bzw. in der ungeladenen Kugel, wenn du die Influenzmaschine anschaltest?</p>\\n\"},\"library\":\"H5P.MultiChoice 1.14\",\"metadata\":{\"contentType\":\"Multiple Choice\",\"license\":\"U\",\"title\":\"Influenz 4\",\"defaultLanguage\":\"de\"},\"subContentId\":\"27d7d7d3-e942-479c-b3db-882a4c363892\"},{\"params\":{\"scoreShow\":\"Überprüfen\",\"tryAgain\":\"Wiederholen\",\"scoreExplanation\":\"Richtige Antworten geben +1 Punkte. Bei falschen Antworten gibt es -1 Punkt. Die kleinstmögliche Punktzahl ist 0.\",\"question\":{\"settings\":{\"size\":{\"width\":800,\"height\":600}},\"task\":{\"elements\":[{\"x\":0,\"y\":0,\"width\":48.280856219709,\"height\":2.0032310177706,\"dropZones\":[],\"type\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Influenz kannst du auch am Elektroskop beobachten. Wenn du einen negativ geladenen Körper in die Nähe von einem Elektroskop bringst, dann schlägt das Elektroskop aus. Aber warum?</p>\\n\\n<p>Bringe die Erklärung in die richtige Reihenfolge!</p>\\n\"},\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitl
